import React from "react";
import WeatherApp from "./WeatherApp";
import "./App.css";

const App = () => {
  return (
    <div>
      <header className="app-header">
        <nav>
          <ul>
            <li>
              <a href="/">Home</a>
            </li>
            <li>
              <a href="/about">About</a>
            </li>
          </ul>
        </nav>
        <h1>Weather App</h1>
      </header>
      <main>
        <WeatherApp />
      </main>
      <footer className="app-footer">
        <p>&copy; 2024 Weather App. All rights reserved.</p>
      </footer>
    </div>
  );
};

export default App;
